        <text>1- Main to FractGen&gt; call fractal generate (construct or &quot;create&quot;)

4- Display to FractalGen &gt; register(this) , register me
5- GUI to FractGen &gt; setData(ratios, colors,_ ...)
6 - FractGen to Display &gt; update(), go through loop of Observers
7 - Display to FractGen&gt; getData(), display says hey give me some data
 ----&gt; Display gets data back all of teh Fractal Elements ArrayList
